/****** Object:  Table Categorias    Script Date: 04/12/2014 23:46:04 ******/

CREATE TABLE Categorias(
	IDCategoria int NOT NULL,
	IDCategoriaPrincipal int NULL,
	Nombre nvarchar(50) NOT NULL,
 CONSTRAINT PKCategorias PRIMARY KEY (IDCategoria)
) 


/****** Object:  Table Clientes    Script Date: 04/12/2014 23:46:04 ******/

CREATE TABLE Clientes(
	ID int NOT NULL,
	Tratamiento nvarchar(8) NULL,
	Nombre nvarchar(50) NOT NULL,
	SegundoNombre nvarchar(50) NULL,
	Apellidos nvarchar(50) NOT NULL,
	NombreEmpresa nvarchar(128) NULL,
	EmailAddress nvarchar(50) NULL,
	Telefono nvarchar(25) NULL,
 CONSTRAINT PKCliente PRIMARY KEY (ID )
) 


/****** Object:  Table LineasPedidos    Script Date: 04/12/2014 23:46:04 ******/

CREATE TABLE LineasPedidos(
	IDPedido int NOT NULL,
	Cantidad smallint NOT NULL,
	IDProducto int NOT NULL,
	precio money NOT NULL,
 CONSTRAINT PKLineasPedidos PRIMARY KEY (IDPedido ,	IDProducto )
)

GO
/****** Object:  Table Pedidos    Script Date: 04/12/2014 23:46:04 ******/


CREATE TABLE Pedidos(
	IDPedido int IDENTITY(1,1) NOT NULL,
	FechaPedido datetime NOT NULL,
	FechaServido datetime NULL,
	FechaEnvio datetime NULL,
	NumeroVenta nvarchar(25) NOT NULL,
	IDCliente int NOT NULL,
	MedioEnvio nvarchar(50) NOT NULL,
	CodigoAprobacionTarjeta varchar(15) NULL,
	SubTotal money NOT NULL,
	Impuestos money NOT NULL,
 CONSTRAINT PKPedidos PRIMARY KEY (IDPedido)
)


GO
/****** Object:  Table Productos    Script Date: 04/12/2014 23:46:04 ******/

CREATE TABLE Productos(
	IDProducto int IDENTITY(1,1) NOT NULL,
	Nombre nvarchar(50) NOT NULL,
	Numero nvarchar(25) NOT NULL,
	Color nvarchar(15) NULL,
	PVP money NOT NULL,
	Volumen nvarchar(5) NULL,
	Peso decimal(8, 2) NULL,
	IDCategoria int NULL,
	FechaLanzamiento datetime NOT NULL,
	FechaRetirada datetime NULL,
	Stock smallint NOT NULL DEFAULT ((50)),
	Sustitutivo int NULL,
 CONSTRAINT PKProductos PRIMARY KEY (IDProducto)
) 

